  <body>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      <h1 style="center">Rate by Run</h1>
    </div>
    <svg id="run" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      Run&nbsp;<sub>min</sub>:&nbsp;<input id="runXMin"/>;
      Run&nbsp;<sub>max</sub>:&nbsp;<input id="runXMax"/>;
      Rate&nbsp;<sub>min</sub>:&nbsp;<input id="runYMin"/>;
      Rate&nbsp;<sub>max</sub>:&nbsp;<input id="runYMax"/>;
      <button onclick="applyRunDomains()">Apply</button>
      <button onclick="resetRunDomains()">Reset</button>
    </div>
    <script>
      var runData = [{"color": "#c0c0c0", "values": [{"y": 101635.72481840871, "x": 40}, {"y": 233173.15085274071, "x": 1000}, {"y": 221035.9608845762, "x": 1400}, {"y": 182226.95533112748, "x": 4000}, {"y": 307623.89198994136, "x": 8900}], "key": "Sending"}, {"color": "#000000", "values": [{"y": 101635.72294710678, "x": 40}, {"y": 233173.10280791111, "x": 1000}, {"y": 221035.89918385295, "x": 1400}, {"y": 182226.94593374574, "x": 4000}, {"y": 307624.2111801866, "x": 8900}], "key": "Receiving"}]

      var runChart
      var runXMin = document.getElementById("runXMin"),
          runXMax = document.getElementById("runXMax"),
          runYMin = document.getElementById("runYMin"),
          runYMax = document.getElementById("runYMax")

      var applyRunDomains = function() {
        runChart.xDomain([runXMin.value, runXMax.value])
        runChart.yDomain([runYMin.value, runYMax.value])
        runChart.update()
      }

      var resetRunDomains = function() {
        runChart.xDomain(null)
        runChart.yDomain(null)
        runChart.update()
      }

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#run')
          runChart = nv.models.lineChart()
          runChart
            .width(svg.attr('width'))
            .dispatch.on('renderEnd', function(){
              var xDomain = runChart.xAxis.domain(),
                  yDomain = runChart.yAxis.domain()
              runXMin.value = xDomain[0]
              runXMax.value = xDomain[1]
              runYMin.value = yDomain[0]
              runYMax.value = yDomain[1]
            })

          runChart.xAxis
            .axisLabel("Run")
            .showMaxMin(false)

          runChart.yAxis
            .axisLabel("Rate, QpS")
            .showMaxMin(false)

          svg.datum(runData).call(runChart)

          return runChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#run')
                graph.width(svg.attr('width'))
                svg.call(graph)
            };
        }
      })
    </script>

<div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      <h1 style="center">Receiving vs Sending</h1>
    </div>
    <svg id="rate" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">

      <button onclick="resetRateDomains()">Reset</button>
    </div>
    <script>
      var rateData = [{"color": "#c0c0c0", "values": [{"y": 101635.72481840871, "x": 101635.72481840871}, {"y": 182226.95533112748, "x": 182226.95533112748}, {"y": 221035.9608845762, "x": 221035.9608845762}, {"y": 233173.15085274071, "x": 233173.15085274071}, {"y": 307623.89198994136, "x": 307623.89198994136}], "key": "Reference"}, {"color": "#000000", "values": [{"y": 101635.72294710678, "x": 101635.72481840871}, {"y": 182226.94593374574, "x": 182226.95533112748}, {"y": 221035.89918385295, "x": 221035.9608845762}, {"y": 233173.10280791111, "x": 233173.15085274071}, {"y": 307624.2111801866, "x": 307623.89198994136}], "key": "Test TCP on 2 c4.xlarge"}]

      var rateChart
      var rateXMin = document.getElementById("rateXMin"),

      var applyRateDomains = function() {
        rateChart.xDomain([rateXMin.value, rateXMax.value])

      var resetRateDomains = function() {
        rateChart.xDomain(null)

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#rate')
          rateChart = nv.models.lineChart()
          rateChart
            .width(svg.attr('width'))
            .dispatch.on('renderEnd', function(){
              var xDomain = rateChart.xAxis.domain(),
                  yDomain = rateChart.yAxis.domain()
              rateXMin.value = xDomain[0]
              rateXMax.value = xDomain[1]
              rateYMin.value = yDomain[0]
              rateYMax.value = yDomain[1]
            })

          rateChart.xAxis
            .axisLabel("Sending, QpS")
            .showMaxMin(false)

          rateChart.yAxis
            .axisLabel("Receiving, QpS")
            .showMaxMin(false)

          svg.datum(rateData).call(rateChart)

          return rateChart
        },
        callback: function(graph) {
            window.onresize = function() {
                var svg = d3.select('#rate')
                graph.width(svg.attr('width'))
                svg.call(graph)

        }
      })

<div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      <h1>Queries Count</h1>
    </div>
    <svg id="counts" style="min-width: 310px; height: 700px; margin: 0 auto"></svg>
    <div style="font-family:arial; font-size:75%; min-width: 310px; margin: 0 auto">
      count&nbsp;<sub>min</sub>:&nbsp;<input id="countsYMin"/>;

      nv.addGraph({
        generate: function() {
          var svg = d3.select('#latency')
          latencyChart = nv.models.lineWithFocusChart()
          latencyChart
            .width(svg.attr('width'))

          latencyChart.xScale(d3.scale.log())

          latencyChart.xAxis
            .tickFormat(function(d) {
              if (d == null) {
                return 'N/A'
              }

              if (d > 999) {
                return d3.format(',.0f')(d/1000) + 'k'
              }

              if (d < 1000 && d > 0.999) {
                return d3.format(',.0f')(d)
              }

              if (d < 1 && d > 0.0999) {
                return  d3.format(',.1f')(d)
              }

              if (d < 0.1 && d > 0.00999) {
                return d3.format(',.2f')(d)
              }

              return d3.format(',.3f')(d)
            })
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.xAxis
            .axisLabel("time, ms")
            .showMaxMin(false)

          latencyChart.yAxis
            .axisLabel("count, %")
            .showMaxMin(false)

          svg.datum(latencyData).call(latencyChart)

          return latencyChart
        },
        callback: function(graph) {

            };
